	//Logging
	static int moduleIdCounter = 1;
	int moduleId;
	private bool ModuleSolved;
	
	void Awake() 
	{
		moduleId = moduleIdCounter++;
		SendButton.OnInteract += delegate() { PressSendButton(); return false; };
		SubmitButton.OnInteract += delegate() { PressSubmitButton(); return false; };
		for (int k = 0; k < Arrows.Length; k++)
        {
            int Movement = k;
            Arrows[Movement].OnInteract += delegate
            {
                ArrowPress(Movement);
                return false;
            };
        }
	}
	
	void Start() 
	{	
		Module.OnActivate += ActivateModule;
	}
	
	void ActivateModule()
	{
		SequenceAndAnswer();
		Display.sprite = Letters[TheCurrentNumber];
		StartCoroutine(DisplayTime());
	}
	
	void SequenceAndAnswer()
	{
		int TheAnchor = UnityEngine.Random.Range(0, TheList.Count());
		int TheOrientation = UnityEngine.Random.Range(0, 2);
		
		if (TheAnchor >= 621 || (TheAnchor > 8 && TheAnchor < 621 && TheOrientation == 1))
		{
			for (int x = 0; x < 5; x++)
			{
				SequenceNumbers[x] = TheList[TheAnchor - x];
			}
			
			for (int y = 0; y < 5; y++)
			{
				RealNumbers[y] = TheList[TheAnchor - (y + 5)];
			}
		}
		
		else
		{
			for (int x = 0; x < 5; x++)
			{
				SequenceNumbers[x] = TheList[TheAnchor + x];
			}
			
			for (int y = 0; y < 5; y++)
			{
				RealNumbers[y] = TheList[TheAnchor + (y + 5)];
			}
		}
		Debug.LogFormat("<A Message #{0}> The initial sequence (in font indices) is {1}", moduleId, SequenceNumbers.Join(" "));
		Debug.LogFormat("[A Message #{0}]=svg[The initial sequence is ]{1}", moduleId, GenerateSVG(SequenceNumbers));
		Debug.LogFormat("<A Message #{0}> The continuation of the sequence (in font indices) is {1}", moduleId, RealNumbers.Join(" "));
		Debug.LogFormat("[A Message #{0}]=svg[The continuation of the sequence is ]{1}", moduleId, GenerateSVG(RealNumbers));
	}
	
	string GenerateSVG(int[] allFonts)
	{
		string svg = "";
		if (allFonts.Length == 1)
		{
			svg = "<svg xmlns=\"http://www.w3.org/2000/svg\" height=\"40px\" viewBox=\"0 0 6.697 9.525\">" + AInSVGs[allFonts[0]] + "</svg>";
		}
		else if (allFonts.Length == 5)
		{
			svg = "<svg xmlns=\"http://www.w3.org/2000/svg\" height=\"40px\" viewBox=\"0 0 40 9.525\">";
			for (int i = 0; i < 5; i++)
			{
				svg += string.Format("<svg x=\"{0}%\">", i * 20);
				svg += AInSVGs[allFonts[i]];
				svg += "</svg>";
			}
			svg += "</svg>";
		}
		return svg;
	}

	IEnumerator DisplayTime()
	{
		for (int x = 0; x < 5; x++)
		{
			yield return new WaitForSecondsRealtime(0.6f);
			TopRenderer[x].sprite = Letters[SequenceNumbers[x]];
			Audio.PlaySoundAtTransform(SFX[2].name, transform);
		}
	}
	
	IEnumerator Inspection()
	{
		Animating = true;
		for (int x = 0; x < 5; x++)
		{
			if (BottomRenderer[x].sprite != Letters[RealNumbers[x]])
			{
				string[] pos = { "1st", "2nd", "3rd", "4th", "5th" };
				Debug.LogFormat("[A Message #{0}] The {1} font style sent for the continuation of the sequence was incorrect. Strike! Resetting...", moduleId, pos[x]);
				RightAnswer = false;
				break;
			}
		}
		if (RightAnswer)
			Debug.LogFormat("[A Message #{0}] All font styles sent for the continuation of the sequence were correct. Module solved!", moduleId);

		for (int x = 0; x < 5; x++)
		{
			yield return new WaitForSecondsRealtime(0.6f);
			TopRenderer[x].sprite = null;
			BottomRenderer[x].sprite = null;
			Audio.PlaySoundAtTransform(SFX[1].name, transform);
		}
		yield return new WaitForSecondsRealtime(0.6f);
		
		if (RightAnswer)
		{
			StartCoroutine(CorrectResponse());
		}
		
		else
		{
			StartCoroutine(IncorrectResponse());
		}
	}
	
	IEnumerator CorrectResponse()
	{
		yield return new WaitForSecondsRealtime(0.6f);
		string[] ModuleSolvedText = {"MODULE", "SOLVED"};
		for (int x = 0; x < 2; x++)
		{
			for (int y = 0; y < ModuleSolvedText[x].Length; y++)
			{
				StatusScreens[x].text += ModuleSolvedText[x][y].ToString();
				Audio.PlaySoundAtTransform(SFX[0].name, transform);
				yield return new WaitForSecondsRealtime(0.1f);
			}
		}
		Display.sprite = null;
		StatusScreens[2].text = "!";
		Module.HandlePass();
		ModuleSolved = true;
	}
	
	IEnumerator IncorrectResponse()
	{
		yield return new WaitForSecondsRealtime(0.6f);
		string[] ModuleSolvedText = {"TRY", "AGAIN"};
		for (int x = 0; x < 2; x++)
		{
			for (int y = 0; y < ModuleSolvedText[x].Length; y++)
			{
				StatusScreens[x].text += ModuleSolvedText[x][y].ToString();
				Audio.PlaySoundAtTransform(SFX[0].name, transform);
				yield return new WaitForSecondsRealtime(0.1f);
			}
		}
		yield return new WaitForSecondsRealtime(0.5f);
		StatusScreens[0].text = "";
		StatusScreens[1].text = "";
		Module.HandleStrike();
		ActivateModule();
		RightAnswer = true;
		Animating = false;
	}
	
	void PressSendButton()
	{
		SendButton.AddInteractionPunch(0.2f);
		if (!ModuleSolved && !Animating)
		{
			for (int x = 0; x < 5; x++)
			{
				if (BottomRenderer[x].sprite == null)
				{
					Debug.LogFormat("<A Message #{0}> Sent the font style (in font index) {1}", moduleId, TheCurrentNumber);
					Debug.LogFormat("[A Message #{0}]=svg[Sent the font style ]{1}", moduleId, GenerateSVG(new[] { TheCurrentNumber }));
					Audio.PlaySoundAtTransform(SFX[2].name, transform);
					BottomRenderer[x].sprite = Display.sprite;
					return;
				}
			}
			Audio.PlaySoundAtTransform(SFX[0].name, transform);
		}
	}
	
	void PressSubmitButton()
	{
		SubmitButton.AddInteractionPunch(0.2f);
		Audio.PlaySoundAtTransform(SFX[0].name, transform);
		if (!ModuleSolved && !Animating)
		{
			for (int x = 0; x < 5; x++)
			{
				if (BottomRenderer[x].sprite == null)
				{
					return;
				}	
			}
			Debug.LogFormat("[A Message #{0}] Pressed submit, verifying answer...", moduleId, TheCurrentNumber);
			StartCoroutine(Inspection());
		}
	}
	
	void ArrowPress(int Movement)
	{
		Arrows[Movement].AddInteractionPunch(0.2f);
		Audio.PlaySoundAtTransform(SFX[0].name, transform);
		if (!ModuleSolved)
		{
			if (Movement == 0)
			{
				TheCurrentNumber = ((TheCurrentNumber - 1) + 32) % 32;
				Display.sprite = Letters[TheCurrentNumber];
			}
			
			else
			{
				TheCurrentNumber = (TheCurrentNumber + 1) % 32;
				Display.sprite = Letters[TheCurrentNumber];
			}
		}
	}
	
	//twitch plays
    #pragma warning disable 414
    private readonly string TwitchHelpMessage = @"!{0} left/right (#) (slow) [Presses the left or right arrow (optionally '#' times and/or slow presses)] | !{0} send [Presses the send button] | !{0} submit [Presses the submit button] | !{0} submitall ## ## [send all fonts with specific index (starts at 1 and ends at 32, use alternate manual to see index of each font). Expected 1 to 5 fonts. If all fonts are entered, the submit button is pressed.]";
    #pragma warning restore 414
    IEnumerator ProcessTwitchCommand(string command)
    {
		string[] parameters = command.Split(' ');
		if (Regex.IsMatch(command, @"^\s*send\s*$", RegexOptions.IgnoreCase | RegexOptions.CultureInvariant))
        {
            yield return null;
            SendButton.OnInteract();
            yield break;
        }
		
		if (Regex.IsMatch(command, @"^\s*submit\s*$", RegexOptions.IgnoreCase | RegexOptions.CultureInvariant))
        {
            yield return null;
			for (int x = 0; x < 5; x++)
			{
				if (BottomRenderer[x].sprite == null)
				{
					yield return "sendtochaterror Pressing submit will only work when 5 letters have been sent!";
					yield break;
				}
			}
			yield return "strike";
			yield return "solve";
            SubmitButton.OnInteract();
        }
		
		if (Regex.IsMatch(parameters[0], @"^\s*left\s*$", RegexOptions.IgnoreCase | RegexOptions.CultureInvariant))
        {
            yield return null;
			if (parameters.Length == 1)
            {
                Arrows[0].OnInteract();
            }
			
			else if (parameters.Length == 2)
            {
                int temp;
                bool check = int.TryParse(parameters[1], out temp);
				if (!check)
                {
                    yield return "sendtochaterror!f The specified number of times to press the left button '" + parameters[1] + "' is not a number!";
                    yield break;
                }
				
				if (temp < 1 || temp > 32)
                {
                    yield return "sendtochaterror The specified number of times to press the left button '" + parameters[1] + "' is under 1 or over 32!";
                    yield break;
                }
				
				for (int i = 0; i < temp; i++)
                {
                    Arrows[0].OnInteract();
                    yield return new WaitForSecondsRealtime(0.1f);
                }
			}
			
			else if (parameters.Length == 3)
            {
                int temp;
                bool check = int.TryParse(parameters[1], out temp);
				if (!check)
                {
                    yield return "sendtochaterror!f The specified number of times to press the left button '" + parameters[1] + "' is not a number!";
                    yield break;
                }
				
				if (temp < 1 || temp > 32)
                {
                    yield return "sendtochaterror The specified number of times to press the left button '" + parameters[1] + "' is under 1 or over 32!";
                    yield break;
                }
				
				if (!Regex.IsMatch(parameters[2], @"^\s*slow\s*$", RegexOptions.IgnoreCase | RegexOptions.CultureInvariant))
                {
                    yield return "sendtochaterror!f A third parameter is only valid if it's 'slow'! Your parameter: '" + parameters[2] + "'.";
                    yield break;
                }
				
				for (int i = 0; i < temp; i++)
                {
                    Arrows[0].OnInteract();
					yield return "trycancel Halted slow button presses due to a request to cancel!";
					yield return new WaitForSecondsRealtime(1f);
                }
			}
			
			else if (parameters.Length > 3)
            {
                yield return "sendtochaterror Too many parameters!";
            }
		}
		
		if (Regex.IsMatch(parameters[0], @"^\s*right\s*$", RegexOptions.IgnoreCase | RegexOptions.CultureInvariant))
        {
            yield return null;
			if (parameters.Length == 1)
            {
                Arrows[1].OnInteract();
            }
			
			else if (parameters.Length == 2)
            {
                int temp;
                bool check = int.TryParse(parameters[1], out temp);
				if (!check)
                {
                    yield return "sendtochaterror!f The specified number of times to press the left button '" + parameters[1] + "' is not a number!";
                    yield break;
                }
				
				if (temp < 1 || temp > 32)
                {
                    yield return "sendtochaterror The specified number of times to press the left button '" + parameters[1] + "' is under 1 or over 32!";
                    yield break;
                }
				
				for (int i = 0; i < temp; i++)
                {
                    Arrows[1].OnInteract();
                    yield return new WaitForSecondsRealtime(0.1f);
                }
			}
			
			else if (parameters.Length == 3)
            {
                int temp;
                bool check = int.TryParse(parameters[1], out temp);
				if (!check)
                {
                    yield return "sendtochaterror!f The specified number of times to press the left button '" + parameters[1] + "' is not a number!";
                    yield break;
                }
				
				if (temp < 1 || temp > 32)
                {
                    yield return "sendtochaterror The specified number of times to press the left button '" + parameters[1] + "' is under 1 or over 32!";
                    yield break;
                }
				
				if (!Regex.IsMatch(parameters[2], @"^\s*slow\s*$", RegexOptions.IgnoreCase | RegexOptions.CultureInvariant))
                {
                    yield return "sendtochaterror!f A third parameter is only valid if it's 'slow'! Your parameter: '" + parameters[2] + "'.";
                    yield break;
                }
				
				for (int i = 0; i < temp; i++)
                {
                    Arrows[1].OnInteract();
					yield return "trycancel Halted slow button presses due to a request to cancel!";
                    yield return new WaitForSecondsRealtime(1f);
                }
			}
			
			else if (parameters.Length > 3)
            {
                yield return "sendtochaterror Too many parameters!";
            }
		}
		if (Regex.IsMatch(command, @"^\s*submitall(?:\s+\d?\d){1,5}\s*$", RegexOptions.CultureInvariant | RegexOptions.IgnoreCase))
		{
			int[] indicesToSubmit = parameters.Skip(1).Select(item => int.Parse(item.Trim()) - 1).ToArray();
			if (indicesToSubmit.Any(x => x < 0 || x > 31))
			{
				yield return "sendtochaterror One of the indices entered is out of range! Ignoring the command.";
			}
			int nullCount = BottomRenderer.Count(r => r.sprite == null);
			if (indicesToSubmit.Length > nullCount)
			{
				yield return "sendtochaterror Too many A's to submit! Ignoring the command.";
				yield break;
			}
			else
			{
				yield return null;
				foreach (int index in indicesToSubmit)
				{
					int distanceLeft = (TheCurrentNumber - index + 32) % 32;
					int distanceRight = (index - TheCurrentNumber + 32) % 32;
					if (distanceLeft < distanceRight)
					{
						for (int i = 0; i < distanceLeft; i++)
						{
							Arrows[0].OnInteract();
							yield return new WaitForSecondsRealtime(0.1f);
						}
					}
					else if (distanceRight < distanceLeft)
					{
						for (int i = 0; i < distanceRight; i++)
						{
							Arrows[1].OnInteract();
							yield return new WaitForSecondsRealtime(0.1f);
						}
					}
					else
					{
						int indexToPress = UnityEngine.Random.Range(0, 2);
						for (int i = 0; i < distanceRight; i++)
						{
							Arrows[indexToPress].OnInteract();
							yield return new WaitForSecondsRealtime(0.1f);
						}
					}
					SendButton.OnInteract();
				}
				if (indicesToSubmit.Length == nullCount)
				{
					yield return "strike";
					yield return "solve";
					SubmitButton.OnInteract();
					yield return new WaitForSecondsRealtime(0.1f);
				}
			}
		}
	}
	
	IEnumerator TwitchHandleForcedSolve()
    {
		int ct = 5;
		for (int x = 0; x < 5; x++)
		{
			if (BottomRenderer[x].sprite == null)
			{
				ct = x;
				break;
			}
		}
		for (int x = 0; x < ct; x++)
		{
			if (BottomRenderer[x].sprite != Letters[RealNumbers[x]])
			{
				StopAllCoroutines();
				Animating = true;
				for (int q = 0; q < 5; q++)
				{
					TopRenderer[q].sprite = null;
					BottomRenderer[q].sprite = null;
				}
				string[] ModuleSolvedText = { "MODULE", "SOLVED" };
				for (int t = 0; t < 2; t++)
				{
					for (int y = 0; y < ModuleSolvedText[t].Length; y++)
					{
						StatusScreens[t].text += ModuleSolvedText[t][y].ToString();
						Audio.PlaySoundAtTransform(SFX[0].name, transform);
						yield return new WaitForSecondsRealtime(0.1f);
					}
				}
				Display.sprite = null;
				StatusScreens[2].text = "!";
				Module.HandlePass();
				ModuleSolved = true;
				yield break;
			}
		}
		if (!Animating)
			yield return ProcessTwitchCommand("submitall " + string.Join(" ", RealNumbers.Skip(ct).Select(x => (x + 1).ToString()).ToArray()));
		while (!ModuleSolved) { yield return true; }
	}
